loadstring(game:HttpGet("https://raw.githubusercontent.com/evelynnscripts/Evelynn-Hub-V9/refs/heads/main/Helpers/Logs.lua",true))()
local Players = game:GetService("Players")
local playerName = Players.LocalPlayer.Name
local gui = Instance.new("ScreenGui", game.CoreGui)
gui.Name = "disableeedGUI"
gui.IgnoreGuiInset = true
gui.ResetOnSpawn = false
local frame = Instance.new("Frame", gui)
frame.Size = UDim2.new(0, 520, 0, 300)
frame.Position = UDim2.new(0.5, -260, 0.5, -150)
frame.BackgroundColor3 = Color3.fromRGB(15, 15, 15)
frame.BackgroundTransparency = 0.15
frame.BorderSizePixel = 0
local corner = Instance.new("UICorner", frame)
corner.CornerRadius = UDim.new(0, 14)
local stroke = Instance.new("UIStroke", frame)
stroke.Thickness = 2
stroke.ApplyStrokeMode = Enum.ApplyStrokeMode.Border
stroke.Color = Color3.fromRGB(0, 100, 255)
stroke.Transparency = 0.5
local title = Instance.new("TextLabel", frame)
title.Size = UDim2.new(1, -20, 0, 40)
title.Position = UDim2.new(0, 10, 0, 12)
title.BackgroundTransparency = 1
title.Text = "Script Disabled"
title.Font = Enum.Font.GothamBlack
title.TextSize = 26
title.TextColor3 = Color3.fromRGB(255, 85, 85)
title.TextXAlignment = Enum.TextXAlignment.Left
local message = Instance.new("TextLabel", frame)
message.Size = UDim2.new(1, -40, 0, 165)
message.Position = UDim2.new(0, 20, 0, 60)
message.BackgroundTransparency = 1
message.TextWrapped = true
message.TextYAlignment = Enum.TextYAlignment.Top
message.Font = Enum.Font.Gotham
message.TextSize = 18
message.TextColor3 = Color3.new(1, 1, 1)
message.Text = "Hey " .. playerName .. ",\n\nThis script is currently disabled due to the new anti-cheat system.\n\nUsing it, or any other scripts now will get you banned — so it's been disabled for your safety.\n\nJoin For Updates - discord.gg/w7D4W4j27j\nhttps://discord.gg/w7D4W4j27j"
local function createFuturisticButton(text, pos, callback)
	local btn = Instance.new("TextButton", frame)
	btn.Size = UDim2.new(0, 200, 0, 42)
	btn.Position = pos
	btn.Text = text
	btn.Font = Enum.Font.GothamBold
	btn.TextSize = 20
	btn.TextColor3 = Color3.fromRGB(255, 255, 255)
	btn.BackgroundColor3 = Color3.fromRGB(0, 120, 255)
	btn.AutoButtonColor = true
	btn.BorderSizePixel = 0
	local glow = Instance.new("UIStroke", btn)
	glow.Thickness = 2
	glow.Color = Color3.fromRGB(0, 170, 255)
	glow.Transparency = 0.25
	local corner = Instance.new("UICorner", btn)
	corner.CornerRadius = UDim.new(0, 8)
	btn.MouseButton1Click:Connect(callback)
	return btn
end
createFuturisticButton("Copy discord Link", UDim2.new(0, 50, 1, -60), function()
	setclipboard("https://discord.gg/w7D4W4j27j")
	message.Text = message.Text .. "\n\n✅ Copied!"
end)
createFuturisticButton("Ok", UDim2.new(1, -250, 1, -60), function()
	gui:Destroy()
end)

